import { useParams } from 'react-router-dom';

export default function Page() {
  const { pageId } = useParams();
  const pageTitles = {
    page1: 'Linear Algebra',
    page2: 'C#',
    page3: 'Data Structure and Algorithm',
    page4: 'System Design',
    page5: 'Multivariable Calculus',
    page6: 'Single Variable Calculus',
    page7: 'Topology',
    page8: 'Algebra 1',
    page9: 'Organic Chemistry',
    page10: 'Classical Mechanics',
    page11: 'Quantum Mechanics',
    page12: 'Electricity and Magnetism',
    page13: 'General Chemistry',
    page14: 'Biology',
    page15: 'Java',
    page16: 'Python',
  };

  return (
    <div style={pageStyle}>
      <header style={headerStyle}>
        <h1>{pageTitles[pageId] || 'Page Not Found'}</h1>
      </header>
      <main style={mainContentStyle}>
        {/* Content for the page */}
        <p>This is the {pageTitles[pageId] || '404 Page'}. Add your content here.</p>
      </main>
    </div>
  );
}

// Styles for the page
const pageStyle = {
  textAlign: 'center',
  padding: '20px',
};

const headerStyle = {
  backgroundColor: '#4CAF50',
  color: 'white',
  padding: '20px',
};

const mainContentStyle = {
  margin: '20px',
};
